import './App.css';

function App() {
  return (
    <div className="App">
      <div className="intro">
        <div className="typewriter">
          <h1>Front End Developer and Mentor</h1>
        </div>
        <div>
          <img src="/me.png"/> 
        </div>
      </div>  
    </div>
  );
}

export default App;
